	public synchronized static PendulumModelInterface getDefaultModel() {
		return new PendulumModel(DEFAULT_X, DEFAULT_Y, DEFAULT_LENGTH, DEFAULT_GRAVITY, DEFAULT_MASS, DEFAULT_FRICTION, DEFAULT_ANGLE);
	}
}

