	public void addPropertyChangeListener(PropertyChangeListener aListener) {
		aPropertyListenerSupport.addElement(aListener);
	}

	@Override
	public void nextPosition() {
		double k = Math.sqrt(mass * gravity / length);
		double h = Math.sqrt(k * k / mass - friction * friction / 4 / mass / mass);
		long t;
		if (enable) {
			t = System.currentTimeMillis() - timer;
		}
		else {
			t = stoptimer - timer;
		}

		double timeInSecond = t/MILLISECOND_PER_SECOND;
		// double angleAtT = angle * Math.cos((Math.sqrt(gravity/(length * LENGTH_SCALE)) * timeInSecond));
		double angleAtT = angle * Math.exp(friction / 2 / mass * (-1) * timeInSecond) * 
				(Math.cos(h * timeInSecond) + friction / 2 / mass / h * Math.sin(h * timeInSecond));
		setHeight((int) Math.round(Math.cos(angleAtT) * length));
